  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Previously known as BESS. The data sets
  are summarized by meaningful Healthcare Common Procedure Coding Current Procedural
  Terminology, HCPC CPT, code ranges. Brief descriptions for the code ranges and modifiers
  are provided in the readme file. The data set name contains the year followed by
  a five character sequence that is the HCPC CPT code. This HCPC CPT code corresponds
  to the first HCPC CPT in the selected code range of disciplines. Within each code
  range are, procedural, condition, or description subheadings. Each data set displays
  the allowed services, allowed charges, and payment amounts by HCPC CPT codes and
  prominent modifiers. These reports will only illustrate the modifiers where duplicative
  claim submissions occur. This is to avoid duplicate counting of services. Utilization
  for modifiers not affected by duplicative counting are collapsed into the Other
  category on the reports. Therefore, not all Centers for Medicare and Medicaid Services
  published modifiers are illustrated. The file is updated annually and usually available
  by September for the previous year.</p>n\",\n\t\"license_title\": \"Other License
